import React from "react";
import styles from './CyberCafe.module.css';
import Aux from '../../../Hoc/Aux/Aux';
import Toolbar from "../../Toolbar/Toolbar";
import SideDrawer from "../../Sidedrawer/Sidedrawer";
import FooterMain from "../../Footer/FooterMain/FooterMain";

const cyberCafe = (props) => (
    <Aux>
        <Toolbar switchBar={props.switchBar}/>

        <SideDrawer backdrop={props.backdrop} 
                    toggleBackdrop={props.toggleBackdrop}
                    switch={props.switch} />

        <div className={styles.HeaderMain}>
            <div className={styles.HeaderImg}>
                {/* <img src={} alt={}/> */}
            </div>

            <div className={styles.HeaderPara}>
                <h2>Browse the Internet</h2>
                <h4>Browse the Internet with Fibre Optic Fast and Secure Internet Connection</h4>
                <h4>Print or copy Any Document</h4>
            </div>
        </div>

        <FooterMain />
    </Aux>
)

export default cyberCafe;
